import Stack from '@mui/material/Stack';
import Button from '@mui/material/Button';

export default function movies() {
  return (
    <div>
      <h2>movies</h2>
      <div>
        <Button variant="contained">Hello world</Button> 
      </div>
    </div>
  )
}



